import axios from "../custom-axios/axios";

const BookingService = {
    fetchHosts: () => {
        return axios.get("/host");
    },
    fetchAccommodations: () => {
        return axios.get("/acc");
    },
    fetchCountries: () => {
        return axios.get("/country");
    },
    deleteAccommodation
}

export default BookingService;
